            "title": "Beach Dexcom Glitter Patch",
            "description": "Show off your Dexcom with the our Original BlackBridgeCreations Glitter Patch!\n\nUse our glitter patch to keep your Dexcom securely attached with style. Our glitter patches can currently be customized for the Dexcom G4 model, Dexcom G5 model, and Dexcom G6. We use medical-grade hypoallergenic tape to make our patches, and offer a wide-array of colors. Each patch is handmade and hand-cut, so there may be slight variations in shape and/or color.\n\nTo make each patch, we use medical-grade, hypoallergenic tapes that we have tested over time. We currently offer patches made with 3M Medipore H Tape and Hypafix Dressing Retention Tape. We chose to offer different brands of tape in order to accommodate individuals who may have sensitivities or irritations to different brands of medical tapes. If you have a favorite medical tape please feel free to message us, as we are always excited to experiment with new brands.\n\nCustom orders are accepted. Please message us if you would like a custom color and/or pattern on your glitter patch, and we will do our best to accommodate.\n\nRecommended use:\nInsert Dexcom device according to manufacturer&#39;s instructions. Then, simply peel off the backing and place the glitter patch over top. The patch should fit snugly, as it helps to keep the Dexcom more secure. As wear-and-tear occur on the patch, some wrinkles may form, although this is completely normal. Using Skin-Tac (either in liquid form or wipes) can help to keep the patch secured longer, although it is not required.   \n\nAs with all patches, swimming and long showers can shorten the lifespan of the patch. After a shower, applying pressure as the patch dries may help to lengthen the lifespan of the adhesive backing.\n\n**If any irritation occurs, please discontinue use immediately.**\n\n*Colors may appear differently depending on monitor settings.*",
