            "description": "Personalized engraved memorial bracelets. Larger/bulk orders can be accommodated.\n**See sizing chart in pictures for sizing reference**\n\n- - - - - - ORDERING\n\nIn the personalization box, notes box at checkout, or by message please include: \n\nLine 1: \nLine 2:\nLine 3:  \nLine 4: \n\nAny combination is welcome - from a single line up to 5.\n\n\nImages (up to 2, optional) If requesting a specific logo, flag, emblem, etc. to be used, please attach the image or include a link if it is found online. \nIf requesting a flag/emblem/logo that is common (ex: US Flag, USMC EGA) you do not need to send a link, unless you prefer a specific design. Good quality, high resolution images work best. \n\nPhotos that are larger in size with good resolution/quality are preferred. \n\nText can also be engraved inside of the bracelet. \n\n\n- - - - - - DESIGN PREVIEW ORDER BEFORE ENGRAVING \nWithin 24 hours of ordering I will send a design preview.  If you are a registered user check in your messages and if checking out as a guest the message should be found in your email you used at checkout. If I do not have a reply back within 24 hours of sending the message we will engrave as you have ordered. \n \n\n\n- - - - - - DETAILS / SPECIFICATIONS\n\n\\The bracelets are black with a gloss finish to them - you are able to feel the engraving. Bracelet wristband sizing is available between the sizes of 5&quot; - 7&quot; (6.5&quot; & 7&quot; are the most requested) and 1/2 an inch wide. \n\nThey are more flexible and not quite as thick as many other bracelets. This minimizes the chance of cracking (common in thicker bands) and gives a more comfortable wear. \n\nThe bracelets used are black without silver or other color of edges. The advantage of this is the bracelets are completely coated, lessening the chance of flaking over time like you see on many other bracelets with the bare edges. \n\nAuthorized to wear with military uniforms. Official Hobbyist of the Marine Corps #19129\n\n\n\n-------\n\nSIZING   (Sizing chart available in pictures)\n\n7 - average (with a looser fit) or larger/wider wrists \n6.5 - average adult size wrists\n6 - smaller adult wrists\n5.5 - small adult wrists or child\n5- child size",
